import React from "react";
import "./sign-in.styles.scss";

const SignIn = () => {
	return (
		<div className="sign-in-container">
			<form className="sign-in-form">
                <input />
                <input />
                <button>Sign in</button>
            </form>
		</div>
	);
};

export default SignIn;
